import React from 'react';
import {makeStyles} from '@mui/styles';
import { Box, Container, Paper } from '@mui/material';
import Accordion from '@mui/material/Accordion';
import AccordionDetails from '@mui/material/AccordionDetails';
import AccordionSummary from '@mui/material/AccordionSummary';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import data from './QuestionApi';

const useStyles = makeStyles(theme =>({
  accordion_details:{
    backgroundColor: theme.palette.primary.main,
    textAlign:'center',
    marginBottom: theme.spacing(5)
  },
  accordion:{
    marginBottom: theme.spacing(2)
  },


}));

const Dark = (props) => {
  const classes = useStyles()
  return (

    <div className={classes.div}>
    <Container>
      <Accordion className={classes.accordion}>
        <AccordionSummary expandIcon={<ExpandMoreIcon />}> <strong> {`Q.${props.id}: `}</strong> {props.question} </AccordionSummary>
        <Paper>
        <AccordionDetails className={classes.accordion_details}>{`Ans :${props.answer}`}</AccordionDetails>
        </Paper>
      </Accordion>
      </Container>

    </div>
  )
}

export default Dark
